import MSFTMetatext, { MetatextTag, } from "./metatext";
import metatextSchema from "./metatext.schema";
import manageJss from "@microsoft/fast-jss-manager-react";
import { MetatextStyles } from "@microsoft/fast-components-styles-msft";
/*
 * The type returned by manageJss type is very complicated so we'll let the
 * compiler infer the type instead of re-declaring just for the package export
 */
/* tslint:disable-next-line:typedef */
const Metatext = manageJss(MetatextStyles)(MSFTMetatext);
export { Metatext, MetatextTag, metatextSchema, };
